import React from 'react';
import './YoutubeComp.css';

const YoutubeComp = () => {
    return (
        <div className={youtube-wrapper}>
            <div className={img-thumb}>
                <img src="" alt=""/>
            </div>
            <p className={title}>Tittle Here</p>
            <p className={desc}>Desc Here</p>
        </div>
    )
}

export default YoutubeComp;
